valid_sol_name(SLVR, NAME) :- 
  solved(SLVR, NAME), 
  (
    dup(NAME) ->
    % format("dup : ~w\n", NAME), 
    false ;
    true
  ),
  (
    error(SLVR, NAME) ->
    % format("error : ~w\n", NAME), 
    false ;
    true
  ),
  true.

valid_sol_names(SLVR, NAMES) :- 
  findall(NAME, valid_sol_name(SLVR, NAME), TEMP),
  sort(TEMP, NAMES).

update_probs(TERMS) :- 
  open('probs.pl', append, STRM), 
  maplist([TERM]>>write_term(STRM, TERM, [fullstop(true), nl(true), quoted(true)]), TERMS), !,
  close(STRM).

